import Head from 'next/head';

export const config = { amp: true };

function TalksPage() {
  return (
    <Layout>
        <Head>
        <title>Naina Raisinghani</title>
        <link rel="icon" href="data:image/svg+xml,<svg xmlns=%22http://www.w3.org/2000/svg%22 viewBox=%220 0 100 100%22><text y=%22.9em%22 font-size=%2290%22>💩</text></svg>" />
        <script async key="amp-youtube" custom-element="amp-youtube" src="https://cdn.ampproject.org/v0/amp-youtube-0.1.js"
            />
        </Head>
      <main>
        <div className="container">
          <div className="title">
              <h2>Google - Mountain View, CA, USA</h2>
              <h3>Software Engineer - AMP</h3>
              <h4>February 2018 - December 2018</h4>
          </div>
          <div className="text">
            <p>
              Mumbo jumbo
            </p>
          </div>

          <div className="title">
            <h2>Google - Mountain View, CA, USA</h2>
            <h3>Software Engineer - AMP</h3>
            <h4>February 2018 - December 2018</h4>
          </div>
          <div className="text">
            <p>
              Mumbo jumbo
            </p>
          </div>

          <div className="title">
            <h2>Google - Sydney, Australia</h2>
            <h3>Software Engineer - Chrome</h3>
            <h4>August 2015 - February 2018</h4>
          </div>
          <div className="text">
            <p>
              Mumbo jumbo
            </p>
          </div>

          <div className="title">
            <h2>Google - Sydney, Australia</h2>
            <h3>Software Engineer Intern</h3>
            <h4>June 2014 - August 2014</h4>
          </div>
          <div className="text">
            <p>
                Mumbo jumbo
            </p>
          </div>

        </div>
      </main>
    <style jsx>{`
    @font-face {
        font-family: 'Bai Jamjuree';
        font-style: sans-serif;
        src: url('https://fonts.googleapis.com/css?family=Bai+Jamjuree');
    }
    * {
        font-family: 'Bai Jamjuree', sans-serif;
        text-decoration: none;
    }
    .container {
        display: grid;
        grid-template-columns: 480px 480px;
        grid-template-rows: 270px;
        grid-gap: 10px;
    }
    .title, .text {
        text-align: center;
        vertical-align: middles;
    }
    main {
        position: fixed;
        margin: 0;
        top: calc(50%);
        left: 50%;
        transform: translate(-50%, -50%);
    }

    @media only screen and (max-width: 768px) {
        .container {
            display: block;
        }    
        main {
            position:relative;
            z-index:-1;
            left: 0;
            transform: translate(0%, 0%);
            top:3.75em;
        }  
    }


  `}</style>
    </Layout>
  );
}

export default TalksPage;
